import React from 'react'
import Marquee from "react-fast-marquee";


export default function Marqueee() {
  return (
    <div className='Marquee'>
      <Marquee>
    <img src='../assets/1.jpg' alt='' />
    <img src='../assets/logo2.png' alt='' />
   
    </Marquee>
    </div>
  )
}
